import { useNavigate } from "react-router";

const PrivateRoute = ()=>{
    let navigate = useNavigate();
    const isAuth = Boolean(true)
    if(!isAuth) {
        return navigate('/admin')
    }
    return navigate('/admin/page')
}

export default PrivateRoute;
